<script>
	import uniIcon from "@/components/uni-icon/uni-icon.vue";
	import uniNavBar from '@/components/uni-nav-bar/uni-nav-bar.vue';
	import {
		mapState,
		mapMutations
	} from 'vuex'

	let that = this;
	var sourceType = [
		['camera'],
		['album'],
		['camera', 'album']
	]
	var sizeType = [
		['compressed'],
		['original'],
		['compressed', 'original']
	]
	export default {
		data() {
			return {
				showPopup:false,
				popupData: {},
				userInfo: {}
			}
		},
		components: {
			uniIcon,
			uniNavBar
		},
		computed: {
			...mapState(['hasLogin', 'forcedLogin'])
		},
		onShow() {
			this.userInfo = uni.getStorageSync('userInfo')
		},
		methods: {
			...mapMutations(['logout']),
			back() {
				uni.navigateBack({
					delta: 1
				})
			},
			bindLogin() {
				uni.navigateTo({
					url: '../../login/login',
				});
			},
			bindLogout() {
				this.logout();
				uni.reLaunch({
					url: '../../login/login',
				});
			},
			showChangeMode: function(name, value) {
				console.log("e-----", name, value)
				this.popupData = {
					title : name,
					value : value
				}
				this.showPopup = true
			},
			sureChange:function(){
				console.log("确认修改")
			},
			chooseImage: function() {
				uni.chooseImage({
					count: 1,
					sizeType: ['compressed'],
					sourceType: ['album'],
					success: (res) => {
						console.log(res.tempFilePaths[0])
						var avatar = res.tempFilePaths[0];

						console.log(avatar)
						uni.uploadFile({
							url: this.$imageUpdate,
							filePath: avatar,
							fileType: 'file',
							name: 'file',
							header: {
								'token': this.$store.state.token
							},
							success: (res) => {
								console.log(res);
								this.userInfo.avatar = res.data.substring(13, 117);
								// this.getUserInfo();
								console.log(this.avatar);

								this.$http
									.post('/mdata/user/foundationUpdate', {
										uuid: this.userInfo.uuid,
										userNameId: this.userInfo.userNameId,
										userName: this.userInfo.userName,
										sex: this.userInfo.sex,
										age: this.userInfo.age || 0,
										postText: this.userInfo.postText,
										post: this.userInfo.post,
										avatar: this.userInfo.avatar,
										telephone: this.userInfo.telephone,
										email: this.userInfo.email,
										cellphone: this.userInfo.cellphone
									}, {
										params: {},
									})
									.then(res => {
										if (res.statusCode == 200) {
											uni.showToast({
												title: '修改成功',
												icon: 'success',
												duration: 1000
											});
										}
									})
									.catch(err => {
										uni.hideLoading();
										uni.showToast({
											title: err.data.message,
											icon: 'none'
										});
									});
							},
							fail: (err) => {
								console.log('uploadImage fail', err);
								uni.showModal({
									content: err.errMsg,
									showCancel: false
								});
							}
						});
					},
					fail: (err) => {
						console.log('chooseImage fail', err)
					}
				})
			}

		},
		onPageScroll(e) {
			//兼容iOS端下拉时顶部漂移
			this.headerPosition = e.scrollTop >= 0 ? "fixed" : "absolute";
			this.headerTop = e.scrollTop >= 0 ? null : 0;
			this.statusTop = e.scrollTop >= 0 ? null : -this.statusHeight + 'px';
		},
		onUnload() {
			this.avatar = '';
		},
		onLoad() {
			this.imageSrc = '';
		}
	}
</script>

